import React, { Component } from 'react';
import CompanyHome from './CompanyHomeComponent';
import { Card, CardTitle, CardText, CardGroup, CardSubtitle, CardHeader,Spinner, Label, CardImg, CardBody, Badge } from 'reactstrap';
import { facilityFailed } from '../redux/ActionCreators';

class Facility extends Component {

    render() {
        if (this.props.facility.isLoading) {
            return (
                <div>
                    <CompanyHome logoutUser={this.props.logoutUser} />
                    <Spinner className="offset-5 mt-5 mb-1" style={{ width: '3rem', height: '3rem' }} type="grow" color="primary" />
                </div>
            );
        }
        else if (this.props.facility.errMess) {
            return (
                <div>
                    <CompanyHome logoutUser={this.props.logoutUser} />
                    <h3>Unable to load Services</h3>
                    <h4>{this.props.facility.errMess}</h4>
                </div>
            );
        }
        else {
            const RenderFacility = this.props.facility.facility.filter(
                facility => facility.username === this.props.auth.user.username
            ).map((facility) => {
                if (facility.service === "Hotel") {
                    return (
                        <Card className="col-4" style={{borderColor: 'white', backgroundColor: '#F8F8F8'}}>
                            <CardHeader>
                                {facility.service}
                                <a
                                style={{textDecoration: 'none'}}
                                className="fa fa-trash fa-lg d-flex justify-content-end"
                                 onClick={() => {
                                    this.props.deleteService(facility._id);
                                }}></a>
                            </CardHeader>
                            <CardImg top src="data:image/jpeg;base64," />
                            <CardBody>
                                <CardTitle><u>Hotel Name - {facility.hotelname}</u></CardTitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Name-{facility.name}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Mobile No.-{facility.mobnumber}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">City -{facility.city}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">State -{facility.state}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Pin Code -{facility.pincode}</CardSubtitle>
                            </CardBody>
                        </Card>
                    );
                }
                else if (facility.service === "Flight") {
                    return (
                        <Card className="col-4" style={{borderColor: 'white', backgroundColor: '#F8F8F8'}}>
                            <CardHeader>
                                {facility.service}
                                <a
                                style={{textDecoration: 'none'}}
                                className="fa fa-trash fa-lg d-flex justify-content-end"
                                 onClick={() => {
                                    this.props.deleteService(facility._id);
                                }}></a>
                            </CardHeader>
                            <CardImg top src="data:image/jpeg;base64," />
                            <CardBody>
                                <CardTitle>
                                    <Badge color="danger" pill>{facility.date}</Badge>{" "}
                                </CardTitle>
                                <CardTitle><u>Flight Name - {facility.flightname}</u>
                                </CardTitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Name-{facility.name}
                                </CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Mobile No.-{facility.mobnumber}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Source -{facility.source}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Destination -{facility.destination}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Departure Time - {facility.time}</CardSubtitle>
                            </CardBody>
                        </Card>

                    );
                }
                else if (facility.service === 'Bus') {
                    return (
                        <Card className="col-4" style={{borderColor: 'white', backgroundColor: '#F8F8F8'}}>
                            <CardHeader>
                                {facility.service}
                                <a
                                style={{textDecoration: 'none'}}
                                className="fa fa-trash fa-lg d-flex justify-content-end"
                                 onClick={() => {
                                    this.props.deleteService(facility._id);
                                }}></a>
                            </CardHeader>
                            <CardImg src="data:image/jpeg;base64," />
                            <CardBody>
                                <CardTitle><u>Bus Name - {facility.busname}</u></CardTitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Name-{facility.name}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Mobile No.-{facility.mobnumber}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Source -{facility.source}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Destination -{facility.destination}</CardSubtitle>
                            </CardBody>
                        </Card>
                    );
                }
                else if (facility.service === "Taxi") {
                    return (
                        <Card className="col-4" style={{borderColor: 'white', backgroundColor: '#F8F8F8'}}>
                            <CardHeader>
                                {facility.service}
                                <a
                                style={{textDecoration: 'none'}}
                                className="fa fa-trash fa-lg d-flex justify-content-end"
                                 onClick={() => {
                                    this.props.deleteService(facility._id);
                                }}></a>
                            </CardHeader>
                            <CardImg src="data:image/jpeg;base64," />
                            <CardBody>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Name-{facility.name}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Mobile No.-{facility.mobnumber}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">City -{facility.city}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">State -{facility.state}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Pin Code -{facility.pincode}</CardSubtitle>
                            </CardBody>
                        </Card>
                    );
                }
                else if (facility.service === 'Ristorante') {
                    return (
                        <Card className="col-4" style={{borderColor: 'white', backgroundColor: '#F8F8F8'}}>
                            <CardHeader>
                                {facility.service}
                                <a
                                style={{textDecoration: 'none'}}
                                className="fa fa-trash fa-lg d-flex justify-content-end"
                                 onClick={() => {
                                    this.props.deleteService(facility._id);
                                }}></a>
                            </CardHeader>
                            <CardImg src="data:image/jpeg;base64," />
                            <CardBody>
                                <CardTitle><u>Ristorante Name - {facility.ristorantename}</u></CardTitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Name-{facility.name}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Mobile No.-{facility.mobnumber}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">City -{facility.city}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">State -{facility.state}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Pin Code -{facility.pincode}</CardSubtitle>
                                <CardSubtitle tag="h6" className="mb-2 text-muted">Home Delivery -{facility.radio1}</CardSubtitle>
                            </CardBody>
                        </Card>
                    );
                }

            })
            return (
                <div>
                    <CompanyHome logoutUser={this.props.logoutUser} />
                    <Label className="d-flex justify-content-center" style={{ color: 'green', fontSize: '20px' }}>Your Services</Label>
                    <div className="row">
                        {RenderFacility}
                    </div>
                </div>
            );
        }

    }
}

export default Facility;